    [],nt"revision_timestamp": "2016-07-27T22:41:22.509000",nt"name": "lower-colorado-river-ecoregion-plan",nt"isopen":
    false,nt"url": null,nt"notes": "This plan includes goals, objectives, stategies
    and action items which were developed for achieving an overall goal of restoring
    and protecting biological diversity in the Lower Colorado River Ecoregion (LCRE).
    An inter-disciplinary Fish and Wildlife Service Team and cooperators from other
    Federal and State agencies developed this plan. Eight goals were identified; 1)
    strengthen existing and foster new, international, intergovernmental, interagency,
    and private-sector partnerships to meet ecosystem restoration and protection goals;
    2) maintain and enhance ecological processes and functions with the LCRE by incorporating
    ecosystem needs into water management operations and by ensuring adequate water
    quality and quantity; 3) prevent extinctions and maintain populations of federally-listed
    threatened and endangered species; 4) protect, restore and enhance trust migratory
    bird populations in the LCRE; 5) protect, restore, and enhance native riparian communities
    within the LCRE; 6) protect, restore, and enhance aquatic marsh communities and
    associated floral and faunal communities in the LCRE; 7) protect, restore, and enhance
    biotic communities within the other components of the LCRE: desertlands, grasslands,
    scrublands, montane woodlands and forests; and 8) provide for sustainable human
    uses on public lands in the LCRE which are consistent with ecosystem restoration
    and protection goals.",nt"license_title": "License Not Specified",nt"extras":
